import React, { Component } from 'react';

class Header extends Component {
	render() {
		return (
			<div className="header">
				<div className="row-nm">
					<div style={{paddingTop: '1em'}}>
								<h1><span className="swash">N</span>e<span className="ss-v">v</span>erla<span className="ss-n">n</span>d</h1>
					</div>
					<div>
							<Link to="/our-story">Our Story</Link>
							<a href="#plants">Plants</a>
							<button style={{marginTop: '4px'}} onClick={this.onClickWaitlist} className="neverland-button"> JOIN THE WAITLIST </button><br/>
					</div>
				</div>
			</div>);
	}
}

export default Header;
